import React from 'react';
import { motion } from 'framer-motion';

const Experience = () => {
  const fadeIn = {
    initial: { opacity: 0, y: 20 },
    animate: { opacity: 1, y: 0 },
    transition: { duration: 0.6, ease: [0.22, 1, 0.36, 1] }
  };

  const experiences = [
    {
      company: "Tech Innovation Labs",
      title: "Machine Learning Engineer",
      date: "2023 - Present",
      description: [
        "Led development of computer vision models for medical image analysis, improving diagnostic accuracy by 25%",
        "Implemented and deployed NLP models for automated document processing, reducing manual review time by 60%",
        "Collaborated with cross-functional teams to integrate ML solutions into production systems",
        "Mentored junior data scientists and contributed to team's best practices documentation"
      ]
    },
    {
      company: "Data Analytics Corp",
      title: "Data Scientist",
      date: "2021 - 2023",
      description: [
        "Developed predictive models for customer churn analysis using machine learning algorithms",
        "Created interactive dashboards using Power BI for real-time business metrics visualization",
        "Optimized data pipelines reducing processing time by 40%",
        "Presented findings to stakeholders and provided actionable recommendations"
      ]
    },
    {
      company: "AI Solutions Inc",
      title: "ML Research Intern",
      date: "2020 - 2021",
      description: [
        "Researched and implemented deep learning models for time series forecasting",
        "Published research findings at international ML conference",
        "Developed proof-of-concept applications using TensorFlow and PyTorch",
        "Collaborated with research team on improving model architectures"
      ]
    }
  ];

  return (
    <section id="experience" className="section">
      <motion.div
        initial="initial"
        whileInView="animate"
        viewport={{ once: true }}
        variants={{
          animate: { transition: { staggerChildren: 0.1 } }
        }}
      >
        <motion.h2 
          variants={fadeIn}
          className="text-h2 text-text mb-8"
        >
          Experience
        </motion.h2>

        <div className="space-y-8">
          {experiences.map((exp, index) => (
            <motion.div
              key={index}
              variants={fadeIn}
              className="bg-background-dark rounded-xl p-6 md:p-8"
            >
              <div className="flex flex-col md:flex-row md:items-start md:justify-between mb-4">
                <div>
                  <h3 className="text-h3 text-text">{exp.company}</h3>
                  <p className="text-body text-primary font-medium">{exp.title}</p>
                </div>
                <p className="text-body text-text-light mt-2 md:mt-0">{exp.date}</p>
              </div>
              
              <ul className="space-y-2">
                {exp.description.map((item, idx) => (
                  <li key={idx} className="text-body text-text-light flex items-start">
                    <span className="w-2 h-2 bg-primary rounded-full mr-2 mt-2" />
                    <span>{item}</span>
                  </li>
                ))}
              </ul>
            </motion.div>
          ))}
        </div>
      </motion.div>
    </section>
  );
};

export default Experience;
